import React from "react";
import "./index.css";

const Modal = () => {

    const submitForm = (event) =>{
        event.preventDefault();
    }
    
  return (
    <div className="modal-container">
    <form className="sms-form" onSubmit={submitForm}>
      <input type="text" placeholder="Student name" className="studentName input" />

      <input type="text" placeholder="Student Address" className="studentAddress input"/>

      <input type="email" placeholder="Student Email" className="studentEmail input"/>

      <button type="submit" className="btn btn-submit">Add Student</button>
    </form>
    </div>
  );
};

export default Modal
